  \"alaska-maritime-national-wildlife-refuge-annual-narrative-report-calendar-year-1994\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Alaska
  Maritime National Wildlife Refuge outlines activities and accomplishments during
  the 1994 calendar year. The report begins with an introduction to the Refuge. Highlights
  and weather conditions are summarized for the year. Information about monitoring
  and studies- including surveys and censuses and studies and investigations- is provided
  next. Habitat restoration and management projects are also covered; activities include
  wetland restoration. Fish and wildlife management are discussed next with emphasis
  on disease monitoring, reintroductions, and animal control. The resource protection
  section provides an update on permits. Information about public education and recreation
  is given including visitor services and outreach. Finally, general administration
  is discussed in the Refuge planning and administration section.\",\n\t\"license_title\":
